lass=&quot;MsoNormal&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/p&gt;&lt;h3 style=&quot;font-family: &amp;quot;Open Sans&amp;quot;, sans-serif; color: rgb(0, 0, 0);&quot;&gt;&lt;b&gt;Zugriffsdaten/ Server-Logfiles&lt;/b&gt;&lt;/h3&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;DE&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;DE&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Der Anbieter (beziehungsweise sein Webspace-Provider) erhebt Daten über jeden Zugriff auf das Angebot (so genannte Serverlogfiles). Zu den Zugriffsdaten gehören: INSERT INTO `oc_information_description` (`information_id`, `language_id`, `title`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('3', '2', 'Datenschutz', '&lt;h2&gt;&lt;b&gt;Datenschutzerklärung&lt;/b&gt;&lt;/h2&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;h3&gt;&lt;b&gt;Geltungsbereich&lt;/b&gt;&lt;/h3&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Diese Datenschutzerklärung klärt Nutzer über die Art, den\r\nUmfang und Zwecke der Erhebung und Verwendung personenbezogener Daten durch den\r\nverantwortlichen Anbieter OHANIR&lt;span lang=&quot;DE&quot; style=&quot;mso-ansi-language:DE&quot;&gt;\r\nGmbH, &lt;/span&gt;&lt;a href=&quot;mailto:office@ohanila.com&quot;&gt;&lt;span lang=&quot;DE&quot; style=&quot;mso-ansi-language:DE&quot;&gt;office@ohanila.com&lt;/span&gt;&lt;/a&gt;&lt;span lang=&quot;DE&quot; style=&quot;mso-ansi-language:DE&quot;&gt;, Salurner Straße 16, 6020 Innsbruck ,&lt;/span&gt;&lt;span lang=&quot;DE&quot;&gt; &lt;/span&gt;&lt;span lang=&quot;DE&quot; style=&quot;mso-ansi-language:DE&quot;&gt;+43 &lt;/span&gt;&lt;span lang=&quot;ZH-CN&quot; style=&quot;&quot;&gt;（&lt;/span&gt;&lt;span lang=&quot;DE&quot; style=&quot;mso-ansi-language:\r\nDE&quot;&gt;0&lt;/span&gt;&lt;span lang=&quot;ZH-CN&quot; style=&quot;&quot;&gt;）&lt;/span&gt;&lt;span lang=&quot;DE&quot; style=&quot;mso-ansi-language:\r\nDE&quot;&gt;512 319 041&lt;/span&gt; auf dieser Website (im folgenden “Angebot”) auf.&lt;o:p&gt;&lt;/o:p&gt;&lt;/font&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;o:p&gt;&lt;font face=&quot;Arial&quot;&gt;&amp;nbsp;&lt;/font&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Die rechtlichen Grundlagen des Datenschutzes finden sich im\r\nBundesdatenschutzgesetz (BDSG) und dem Telemediengesetz (TMG).&lt;o:p&gt;&lt;/o:p&gt;&lt;/font&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/p&gt;&lt;h3&gt;&lt;b&gt;Zugriffsdaten/ Server-Logfiles&lt;/b&gt;&lt;/h3&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;DE&quot; style=&quot;mso-ansi-language:DE&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;DE&quot; style=&quot;mso-ansi-language:DE&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Der Anbieter\r\n(beziehungsweise sein Webspace-Provider) erhebt Daten über jeden Zugriff auf\r\ndas Angebot (so genannte Serverlogfiles). Zu den Zugriffsdaten gehören: INSERT INTO `oc_information_description` (`information_id`, `language_id`, `title`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('4', '1', 'About Us', '&lt;p class=&quot;MsoNormal&quot;&gt;&lt;img src=&quot;http://www.ohanir-wedding.at/images/photos.jpg&quot; width=&quot;946&quot; height=&quot;436&quot; style=&quot;margin: 0px; padding: 0px; outline: 0px; background: transparent; color: rgb(106, 106, 106); font-family: &amp;quot;Microsoft YaHei&amp;quot;, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; text-align: start;&quot;&gt;&lt;br style=&quot;color: rgb(106, 106, 106); font-family: &amp;quot;Microsoft YaHei&amp;quot;, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; text-align: start;&quot;&gt;&lt;br style=&quot;color: rgb(106, 106, 106); font-family: &amp;quot;Microsoft YaHei&amp;quot;, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; text-align: start;&quot;&gt;&lt;br style=&quot;color: rgb(106, 106, 106); font-family: &amp;quot;Microsoft YaHei&amp;quot;, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; text-align: start;&quot;&gt;&lt;/p&gt;&lt;table width=&quot;100%&quot; border=&quot;0&quot; style=&quot;margin: 0px; padding: 0px; border: 0px; color: rgb(106, 106, 106); font-family: &amp;quot;Microsoft YaHei&amp;quot;, Arial, Helvetica, sans-serif, 宋体; font-size: 14px;&quot;&gt;&lt;tbody&gt;&lt;tr style=&quot;margin: 0px; padding: 0px; border: 0px;&quot;&gt;&lt;td width=&quot;46%&quot; style=&quot;margin: 0px; border: 0px;&quot;&gt;&lt;p style=&quot;margin-bottom: 10px; padding: 0px; border: 0px; outline: 0px; background: transparent; font-size: 20px;&quot;&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; padding: 0px; border: 0px; outline: 0px; background: transparent;&quot;&gt;Unser Geschäft und sein Team stehen für exzellente Qualität und beste Beratung rund um Hochzeit sowie Abendmode. Wir setzen alles daran Ihre Wünsche und Erwartungen zu bester Zufriedenheit zu erfüllen, damit Sie nicht nur am schönsten Tag in Ihrem Leben strahlen. Gerne organisieren unsere Eventmanager sowie Wedding Planner auch auf Wunsch diverse Angelegenheiten für Sie.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; padding: 0px; border: 0px; outline: 0px; background: transparent;&quot;&gt;Die Marken Hania &amp;amp; Lulinda stehen für außergewöhnliche Handarbeitskunst, traditionell gefertigt mit exzellentem Design sowie Verarbeitung.&lt;/p&gt;&lt;/td&gt;&lt;td width=&quot;7%&quot; style=&quot;margin: 0px; border: 0px;&quot;&gt;&amp;nbsp;&lt;/td&gt;&lt;td width=&quot;47%&quot; style=&quot;margin: 0px; border: 0px;&quot;&gt;&lt;p style=&quot;margin-bottom: 10px; padding: 0px; border: 0px; outline: 0px; background: transparent; font-size: 20px;&quot;&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; padding: 0px; border: 0px; outline: 0px; background: transparent;&quot;&gt;Unser Ziel ist es Kunden mit der Qualität unserer Produkte sowie dem unübertroffenem Preis-Leistungs-Verhältnis zu begeistern. Dies wird vor allem mit einer eigenen Manufaktur im Mode sowie Schmuckbereich realisiert. Auch unsere kompetente Beratung vor Ort sowie die außergewöhnliche Dienstleistungen, zeigen dass hier individuelle Kundenwünsche zählen.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; padding: 0px; border: 0px; outline: 0px; background: transparent;&quot;&gt;Lernen Sie unser Geschäft im Herzen von Innsbruck kennen.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; padding: 0px; border: 0px; outline: 0px; background: transparent;&quot;&gt;&lt;span style=&quot;background-color: transparent; text-align: center;&quot;&gt;Statten Sie unserem Studio im Zentrum doch einen Besuch ab und finden Sie Ihr Traum Hochzeitskleid, Ballkleid sowie andere Abendmode und traumhaften Schmuck.&lt;/span&gt;&lt;/p&gt;&lt;/td&gt;&lt;/tr&gt;&lt;/tbody&gt;&lt;/table&gt;\r\n&lt;style&gt;\r\n&lt;!--\r\n /* Font Definitions */\r\n@font-face\r\n\t{font-family:宋体;\r\n\tmso-font-charset:134;\r\n\tmso-generic-font-family:auto;\r\n\tmso-font-pitch:variable;\r\n\tmso-font-signature:3 680460288 22 0 262145 0;}\r\n@font-face\r\n\t{font-family:&quot;Cambria Math&quot;;\r\n\tpanose-1:2 4 5 3 5 4 6 3 2 4;\r\n\tmso-font-charset:1;\r\n\tmso-generic-font-family:roman;\r\n\tmso-font-format:other;\r\n\tmso-font-pitch:variable;\r\n\tmso-font-signature:0 0 0 0 0 0;}\r\n /* Style Definitions */\r\np.MsoNormal, li.MsoNormal, div.MsoNormal\r\n\t{mso-style-unhide:no;\r\n\tmso-style-qformat:yes;\r\n\tmso-style-parent:&quot;&quot;;\r\n\tmargin:0in;\r\n\tmargin-bottom:.0001pt;\r\n\ttext-align:justify;\r\n\ttext-justify:inter-ideograph;\r\n\tmso-pagination:none;\r\n\tfont-size:12.0pt;\r\n\tfont-family:&quot;Times New Roman&quot;,serif;\r\n\tmso-fareast-font-family:宋体;\r\n\tmso-fareast-theme-font:minor-fareast;\r\n\tmso-font-kerning:1.0pt;}\r\n.MsoChpDefault\r\n\t{mso-style-type:export-only;\r\n\tmso-default-props:yes;\r\n\tmso-fareast-font-family:宋体;\r\n\tmso-fareast-theme-font:minor-fareast;\r\n\tmso-font-kerning:1.0pt;}\r\n@page WordSection1\r\n\t{size:595.0pt 842.0pt;\r\n\tmargin:1.0in 1.25in 1.0in 1.25in;\r\n\tmso-header-margin:42.55pt;\r\n\tmso-footer-margin:49.6pt;\r\n\tmso-paper-source:0;\r\n\tlayout-grid:21.15pt;}\r\ndiv.WordSection1\r\n\t{page:WordSection1;}\r\n--&gt;\r\n&lt;/style&gt;', 'About Us', '', '');
