INSERT INTO `oc_information_description` (`information_id`, `language_id`, `title`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('7', '1', 'Impressum', '&lt;p style=&quot;font-family: &amp;quot;Open Sans&amp;quot;, sans-serif; color: rgb(0, 0, 0);&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;br class=&quot;Apple-interchange-newline&quot;&gt;&lt;/font&gt;&lt;font face=&quot;Arial&quot;&gt;OHANIR GmbH&lt;br&gt;&lt;/font&gt;&lt;font face=&quot;Arial&quot;&gt;Salurner Straße 16&lt;br&gt;&lt;/font&gt;&lt;font face=&quot;Arial&quot;&gt;6020 Innsbruck&lt;br&gt;&lt;/font&gt;&lt;font face=&quot;Arial&quot;&gt;Telefon: +43&amp;nbsp;&lt;span lang=&quot;ZH-CN&quot;&gt;（&lt;/span&gt;0&lt;span lang=&quot;ZH-CN&quot;&gt;）&lt;/span&gt;512 319 041&lt;br&gt;&lt;/font&gt;&lt;font face=&quot;Arial&quot;&gt;Telefax: +43&amp;nbsp;&lt;span lang=&quot;ZH-CN&quot;&gt;（&lt;/span&gt;0&lt;span lang=&quot;ZH-CN&quot;&gt;）&lt;/span&gt;512 319 041&lt;br&gt;&lt;/font&gt;&lt;font face=&quot;Arial&quot;&gt;E-Mail:&amp;nbsp;&lt;a href=&quot;mailto:office@ohanila.com&quot;&gt;office@ohanila.com&lt;/a&gt;&lt;/font&gt;&lt;/p&gt;&lt;h1 style=&quot;font-family: &amp;quot;Open Sans&amp;quot;, sans-serif; color: rgb(0, 0, 0);&quot;&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;font-family: &amp;quot;Open Sans&amp;quot;, sans-serif;&quot;&gt;&lt;span style=&quot;font-size: 12pt;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;/h1&gt;&lt;h2 style=&quot;font-family: &amp;quot;Open Sans&amp;quot;, sans-serif; color: rgb(0, 0, 0);&quot;&gt;&lt;b&gt;Hinweis gemäß Online-Streitbeilegungs-Verordnung&lt;/b&gt;&lt;/h2&gt;&lt;h1 style=&quot;font-family: &amp;quot;Open Sans&amp;quot;, sans-serif; color: rgb(0, 0, 0);&quot;&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;DE&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;br&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;/h1&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span lang=&quot;DE&quot;&gt;Nach geltendem Recht sind wir verpflichtet, Verbraucher auf die Existenz der Europäischen Online-Streitbeilegungs-Plattform hinzuweisen, die für die Beilegung von Streitigkeiten genutzt werden kann, ohne dass ein Gericht eingeschaltet werden muss. Für die Einrichtung der Plattform ist die Europäische Kommission zuständig. Die Europäische Online-Streitbeilegungs-Plattform ist hier zu finden:&amp;nbsp;&lt;/span&gt;&lt;a href=&quot;http://ec.europa.eu/odr&quot;&gt;&lt;span lang=&quot;DE&quot;&gt;http://ec.europa.eu/odr&lt;/span&gt;&lt;/a&gt;&lt;span lang=&quot;DE&quot;&gt;.&amp;nbsp;&lt;/span&gt;Unsere E-Mail lautet:&amp;nbsp;&lt;a href=&quot;mailto:office@ohanila.com&quot;&gt;office@ohanila.com&lt;br&gt;&lt;/a&gt;&lt;/font&gt;&lt;span lang=&quot;DE&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Wir weisen aber darauf hin, dass wir nicht bereit sind, uns am Streitbeilegungsverfahren im Rahmen der Europäischen Online-Streitbeilegungs-Plattform zu beteiligen. Nutzen Sie zur Kontaktaufnahme bitte unsere obige E-Mail und Telefonnummer.&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;h4 style=&quot;font-family: &amp;quot;Open Sans&amp;quot;, sans-serif; color: rgb(0, 0, 0);&quot;&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;DE&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;/h4&gt;&lt;h2 style=&quot;font-family: &amp;quot;Open Sans&amp;quot;, sans-serif; color: rgb(0, 0, 0);&quot;&gt;&lt;b&gt;Hinweis gemäß Verbraucherstreitbeilegungsgesetz (VSBG)&lt;/b&gt;&lt;/h2&gt;&lt;h2 style=&quot;font-family: &amp;quot;Open Sans&amp;quot;, sans-serif; color: rgb(0, 0, 0);&quot;&gt;&lt;/h2&gt;&lt;p&gt;&lt;span lang=&quot;DE&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Wir sind nicht bereit und verpflichtet, an Streitbeilegungsverfahren vor einer Verbraucherschlichtungsstelle teilzunehmen.&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;h2 style=&quot;color: rgb(0, 0, 0);&quot;&gt;\r\n\r\n&lt;!--EndFragment--&gt;&lt;/h2&gt;&lt;style&gt;\r\n&lt;!--\r\n /* Font Definitions */\r\n@font-face\r\n\t{font-family:宋体;\r\n\t