INSERT INTO `oc_modification` (`modification_id`, `name`, `code`, `author`, `version`, `link`, `xml`, `status`, `date_added`) VALUES ('4', 'C2 Multiupload files light OSMOD', 'C2 Multiupload files light OSMOD', 'Chumachkin Mikhail Aleksandrovich chumachkin.m@gmail.com', '1.1.6', 'http://nuvoletta.ru/opencart_multiupload_files', '<?xml version="1.0" encoding="utf-8"?>\r\n<modification>\r\n    <name>C2 Multiupload files light OSMOD</name>\r\n    <code>C2 Multiupload files light OSMOD</code>\r\n    <version>1.1.6</version>\r\n    <author>Chumachkin Mikhail Aleksandrovich chumachkin.m@gmail.com</author>\r\n    <link>http://nuvoletta.ru/opencart_multiupload_files</link>\r\n\r\n    <!-- \r\n    -\r\n    -\r\n    -\r\n    -->\r\n    <file path="admin/view/template/common/filemanager.tpl">\r\n        <operation error="skip">\r\n            <search index="0"><![CDATA[\r\n                $(\'body\').prepend(\'<form enctype="multipart/form-data" id="form-upload" style="display: none;"><input type="file" name="file" value="" /></form>\');\r\n            ]]></search>\r\n            <add  position="replace" trim="false"><![CDATA[\r\n                $(\'body\').prepend(\'<form enctype="multipart/form-data" id="form-upload" style="display: none;"><input id="multiple_upload_file" type="file" multiple name="file[]" value="" /></form>\');\r\n            ]]></add>\r\n        </operation>\r\n    </file>\r\n\r\n\r\n    <!-- \r\n    -\r\n    -\r\n    -\r\n    -->\r\n    <file path="admin/view/template/common/filemanager.tpl">\r\n        <operation error="skip">\r\n            <search index="0"><![CDATA[\r\n                $(\'#form-upload input[name=\\\'file\\\']\').trigger(\'click\');\r\n            ]]></search>\r\n            <add  position="replace" trim="false"><![CDATA[\r\n                $(\'#form-upload input#multiple_upload_file\').trigger(\'click\');\r\n            ]]></add>\r\n        </operation>\r\n    </file>\r\n\r\n\r\n    <!-- \r\n    -\r\n    -\r\n    -\r\n    -->\r\n    <