ue) is a function it\'s a converter...\r\n                result = read(cookie, value);\r\n                break;\r\n            }\r\n\r\n            // Prevent storing a cookie that we couldn\'t decode.\r\n            if (!key && (cookie = read(cookie)) !== undefined) {\r\n                result[name] = cookie;\r\n            }\r\n        }\r\n\r\n        return result;\r\n    };\r\n\r\n    config.defaults = {};\r\n\r\n    $.removeCookie = function (key, options) {\r\n        // Must not alter options, thus extending a fresh object...\r\n        $.cookie(key, \'\', $.extend({}, options, { expires: -1 }));\r\n        return !$.cookie(key);\r\n    };\r\n\r\n}));\r\n            ]]></add>\r\n        </operation>\r\n    </file>\r\n\r\n    <!-- \r\n    -\r\n    -\r\n    -\r\n    -->\r\n    <file path="admin/view/template/common/filemanager.tpl">\r\n        <operation error="skip">\r\n            <search index="0"><![CDATA[\r\n$(\'a.thumbnail\').on(\'click\', function(e) {\r\n            ]]></search>\r\n            <add  position="before" trim="false"><![CDATA[\r\n$( document ).ready(function() {\r\n    var c2_directory_url = decodeURIComponent($.cookie(\'c2_directory\'));\r\n    var c2_cur_url = decodeURIComponent(\'<?php echo htmlspecialchars_decode(urldecode($directory)); ?>\');\r\n\r\n    //debugger;\r\n\r\n    if ( c2_cur_url.length === 0 ) c2_cur_url = \'/\';\r\n    if ( c2_directory_url === "undefined" ) c2_directory_url = c2_cur_url;\r\n\r\n    if ( c2_cur_url.indexOf(c2_directory_url) === -1 && c2_directory_url.length !== 0 ) {\r\n        $(\'#modal-image\').load( \'\'.concat(\'index.php?route=common/filemanager&token=<?php echo $token; ?>&directory=\', encodeURIComponent(c2_directory_url), \'&target=<?php echo $target; ?>&thumb=<?php echo $thumb; ?>\') );\r\n    }\r\n});\r\n\r\n// Move image to Imagw folder\r\n$(\'#button-moveimage\').on(\'click\', function(e) {\r\n    e.preventDefault();\r\n    e.stopPropagation();\r\n\r\n    var cnt = 0 ;\r\n\r\n    $.each($(\'div.modal-body\').find(\'input[type="checkbox"]\'), function(){\r\n        if ( $(this).prop(\'checked\') === true && $(this).prop(\'name\') == \'path[]\' ) {\r\n            var img_el = $(this).parent().parent().find(\'img\').first();\r\n        \r\n            var image_id = parent.image_row; // row index\r\n            parent.addImage(); // add row in image Tab\r\n            var cur_block = $(\'#image-row\'.concat(image_id)); // Added block\r\n    \r\n            parent.$(\'#thumb-image\' + image_id + \' > img \').attr(\'src\', $(img_el).attr(\'src\'));\r\n            parent.$(\'#input-image\' + image_id ).val( $(this).attr(\'value\') );\r\n            cnt++;\r\n        }\r\n    });\r\n\r\n    if ( cnt > 0) {\r\n        $(\'#modal-image\').modal(\'hide\');\r\n        parent.$(\'a[href="#tab-image"]\').trigger(\'click\');\r\n    } else {\r\n        alert(\'Select image files to add it.\');\r\n    }\r\n});\r\n\r\n// Select all visible images \r\n$(\'#button-selectvisibleimages\').on(\'click\', function(e) {\r\n    e.preventDefault();\r\n    e.stopPropagation();\r\n\r\n    $.each( $(\'div.modal-body input[type="checkbox"]\'), function(){\r\n        if ( $(this).prop(\'checked\') === false ) {\r\n            $(this).prop(\'checked\',true);            \r\n        }\r\n    });\r\n\r\n});\r\n\r\n\r\n// Unselect all visible images \r\n$(\'#button-unselectvisibleimages\').on(\'click\', function(e) {\r\n    e.preventDefault();\r\n    e.stopPropagation();\r\n\r\n    $.each( $(\'div.modal-body input[type="checkbox"]\'), function(){\r\n        if ( $(this).prop(\'checked\') === true ) {\r\n            $(this).prop(\'checked\',false);            \r\n        }\r\n    });\r\n\r\n});\r\n\r\n\r\n// Invers selection all visible images \r\n$(\'#button-inversselectvisibleimages\').on(\'click\', function(e) {\r\n    e.preventDefault();\r\n    e.stopPropagation();\r\n\r\n    $.each( $(\'div.modal-body input[type="checkbox"]\'), function(){\r\n        if ( $(this).prop(\'checked\') === true ) {\r\n            $(this).prop(\'checked\',false);            \r\n        } else {\r\n            $(this).prop(\'checked\',true);\r\n        }\r\n    });\r\n\r\n});\r\n\r\n            ]]></add>\r\n        </operation>\r\n    </file>\r\n\r\n    <!-- \r\n    -\r\n    -\r\n    -\r\n    -->\r\n    <file path="admin/controller/common/filemanager.php">\r\n        <!-- Opencart 2.3.0.2 fix search-->\r\n        <operation error="skip">\r\n            <search index="0"><![CDATA[\r\n            $filter_name = rtrim(str_replace(\'*\', \'\', $this->request->get[\'filter_name\']), \'/\');\r\n            ]]></search>\r\n            <add  position="replace" trim="false"><![CDATA[\r\n            $filter_name = rtrim(str_replace(array(\'*\', \'/\'), \'\', $this->request->get[\'filter_name\']), \'/\');\r\n            ]]></add>\r\n        </operation>\r\n    </file>\r\n\r\n    <!-- \r\n    -\r\n    -\r\n    -\r\n    -->\r\n    <file path="admin/controller/common/filemanager.php">\r\n        <!-- Opencart 2.3.0.2 fix search-->\r\n        <operation error="skip">\r\n            <search index="0"><![CDATA[\r\n        if (substr(str_replace(\'\\\\\', \'/\', realpath($directory . \'/\' . $filter_name)), 0, strlen(DIR_IMAGE . \'catalog\')) == DIR_IMAGE . \'catalog\') {\r\n            ]]></search>\r\n            <add  position="replace" trim="false"><![CDATA[\r\n        if (substr(str_replace(\'\\\\\', \'/\', realpath($directory) . \'/\' . $filter_name), 0, strlen(DIR_IMAGE . \'catalog\')) == DIR_IMAGE . \'catalog\') {\r\n            ]]></add>\r\n        </operation>\r\n    </file>\r\n\r\n    <!-- \r\n    -\r\n    -\r\n    -\r\n    -->\r\n    <file path="admin/controller/common/filemanager.php">\r\n        <operation error="skip">\r\n            <search index="0"><![CDATA[\r\n        $data[\'pagination\'] = $pagination->render();\r\n            ]]></search>\r\n            <add  position="after" trim="false"><![CDATA[\r\n            ]]></add>\r\n        </operation>\r\n    </file>\r\n\r\n    <!-- \r\n    -\r\n    -\r\n    -\r\n    -->\r\n    <file path="admin/controller/common/filemanager.php">\r\n        <operation error="skip">\r\n            <search index="0"><![CDATA[\r\n    public function index() {\r\n            ]]></search>\r\n            <add  position="replace" trim="false"><![CDATA[\r\n    public function index() {\r\n\r\n        $memory_limit = ini_get(\'memory_limit\');\r\n\r\n        $default_mempory_limit = 32 * 1024 * 1024; \r\n\r\n        if ( $memory_limit == -1 ) {\r\n            $memory_limit = $default_mempory_limit;\r\n        } else {\r\n            if (preg_match(\'/^(\\d+)(.)$/i\', $memory_limit, $matches)) {\r\n                if ( strtoupper($matches[2]) == \'M\') {\r\n                    $memory_limit = (int)$matches[1] * 1024 * 1024; \r\n                } else if ( strtoupper($matches[2]) == \'K\') {\r\n                    $memory_limit = (int)$matches[1] * 1024;\r\n                }else if ( strtoupper($matches[2]) == \'G\') {\r\n                    $memory_limit = (int)$matches[1] * 1024 * 1024 * 1024;\r\n                }\r\n            } else {\r\n                $memory_limit = $default_mempory_limit;\r\n            }\r\n        }\r\n        \r\n        $enoughmem = function($image_file) use($memory_limit) {\r\n            $rgb = 3;\r\n            if (!is_file(DIR_IMAGE . $image_file)) {\r\n                return false;\r\n            }\r\n            list ($x, $y) = getimagesize(DIR_IMAGE . $image_file);\r\n            $mem_used = $x * $y * $rgb * 1.7;\r\n            return ( $mem_used < $memory_limit - memory_get_usage() );\r\n        };\r\n\r\n            ]]></add>\r\n        </operation>\r\n    </file>\r\n\r\n    <!-- \r\n    -\r\n    -\r\n    -\r\n    -->\r\n    <file path="admin/controller/common/filemanager.php">\r\n        <operation error="skip">\r\n            <search index="0"><![CDATA[\r\n                    \'thumb\' => $this->model_tool_image->resize(utf8_substr($image, utf8_strlen(DIR_IMAGE)), 100, 100),\r\n            ]]></search>\r\n            <add  position="replace" trim="false"><![CDATA[\r\n                    \'thumb\' => ( $enoughmem(utf8_substr($image, utf8_strlen(DIR_IMAGE))) ) ? $this->model_tool_image->resize(utf8_substr($image, utf8_strlen(DIR_IMAGE)), 100, 100) : $this->model_tool_image->resize(\'no_image.png\', 100, 100),\r\n            ]]></add>\r\n        </operation>\r\n    </file>\r\n\r\n    <!-- \r\n    -\r\n    -\r\n    -\r\n    -->\r\n    <file path="admin/controller/common/filemanager.php">\r\n        <operation error="skip">\r\n            <search index="0"><![CDATA[\r\n                    \'href\'  => $server . \'image/\' . utf8_substr($image, utf8_strlen(DIR_IMAGE))\r\n            ]]></search>\r\n            <add  position="replace" trim="false"><![CDATA[\r\n                    \'href\' => ( $enoughmem(utf8_substr($image, utf8_strlen(DIR_IMAGE))) ) ? $server . \'image/\' . utf8_substr($image, utf8_strlen(DIR_IMAGE)) : \'no_image.png\',\r\n            ]]></add>\r\n        </operation>\r\n    </file>\r\n\r\n    <!-- \r\n    -\r\n    -\r\n    -\r\n    -->\r\n    <file path="admin/controller/common/filemanager.php">\r\n        <operation error="skip">\r\n            <search index="0"><![CDATA[\r\n            if (!empty($this->request->files[\'file\'][\'name\']) && is_file($this->request->files[\'file\'][\'tmp_name\'])) {\r\n            ]]></search>\r\n            <add  position="before" trim="false" offset="2"><![CDATA[\r\n\r\n        $removeAccents = function ($str) {\r\n            $a = array(\'À\', \'Á\', \'Â\', \'Ã\', \'Ä\', \'Å\', \'Æ\', \'Ç\', \'È\', \'É\', \'Ê\', \'Ë\', \'Ì\', \'Í\', \'Î\', \'Ï\', \'Ð\', \'Ñ\', \'Ò\', \'Ó\', \'Ô\', \'Õ\', \'Ö\', \'Ø\', \'Ù\', \'Ú\', \'Û\', \'Ü\', \'Ý\', \'ß\', \'à\', \'á\', \'â\', \'ã\', \'ä\', \'å\', \'æ\', \'ç\', \'è\', \'é\', \'ê\', \'ë\', \'ì\', \'í\', \'î\', \'ï\', \'ñ\', \'ò\', \'ó\', \'ô\', \'õ\', \'ö\', \'ø\', \'ù\', \'ú\', \'û\', \'ü\', \'ý\', \'ÿ\', \'Ā\', \'ā\', \'Ă\', \'ă\', \'Ą\', \'ą\', \'Ć\', \'ć\', \'Ĉ\', \'ĉ\', \'Ċ\', \'ċ\', \'Č\', \'č\', \'Ď\', \'ď\', \'Đ\', \'đ\', \'Ē\', \'ē\', \'Ĕ\', \'ĕ\', \'Ė\', \'ė\', \'Ę\', \'ę\', \'Ě\', \'ě\', \'Ĝ\', \'ĝ\', \'Ğ\', \'ğ\', \'Ġ\', \'ġ\', \'Ģ\', \'ģ\', \'Ĥ\', \'ĥ\', \'Ħ\', \'ħ\', \'Ĩ\', \'ĩ\', \'Ī\', \'ī\', \'Ĭ\', \'ĭ\', \'Į\', \'į\', \'İ\', \'ı\', \'Ĳ\', \'ĳ\', \'Ĵ\', \'ĵ\', \'Ķ\', \'ķ\', \'Ĺ\', \'ĺ\', \'Ļ\', \'ļ\', \'Ľ\', \'ľ\', \'Ŀ\', \'ŀ\', \'Ł\', \'ł\', \'Ń\', \'ń\', \'Ņ\', \'ņ\', \'Ň\', \'ň\', \'ŉ\', \'Ō\', \'ō\', \'Ŏ\', \'ŏ\', \'Ő\', \'ő\', \'Œ\', \'œ\', \'Ŕ\', \'ŕ\', \'Ŗ\', \'ŗ\', \'Ř\', \'ř\', \'Ś\', \'ś\', \'Ŝ\', \'ŝ\', \'Ş\', \'ş\', \'Š\', \'š\', \'Ţ\', \'ţ\', \'Ť\', \'ť\', \'Ŧ\', \'ŧ\', \'Ũ\', \'ũ\', \'Ū\', \'ū\', \'Ŭ\', \'ŭ\', \'Ů\', \'ů\', \'Ű\', \'ű\', \'Ų\', \'ų\', \'Ŵ\', \'ŵ\', \'Ŷ\', \'ŷ\', \'Ÿ\', \'Ź\', \'ź\', \'Ż\', \'ż\', \'Ž\', \'ž\', \'ſ\', \'ƒ\', \'Ơ\', \'ơ\', \'Ư\', \'ư\', \'Ǎ\', \'ǎ\', \'Ǐ\', \'ǐ\', \'Ǒ\', \'ǒ\', \'Ǔ\', \'ǔ\', \'Ǖ\', \'ǖ\', \'Ǘ\', \'ǘ\', \'Ǚ\', \'ǚ\', \'Ǜ\', \'ǜ\', \'Ǻ\', \'ǻ\', \'Ǽ\', \'ǽ\', \'Ǿ\', \'ǿ\');\r\n            $b = array(\'A\', \'A\', \'A\', \'A\', \'A\', \'A\', \'AE\', \'C\', \'E\', \'E\', \'E\', \'E\', \'I\', \'I\', \'I\', \'I\', \'D\', \'N\', \'O\', \'O\', \'O\', \'O\', \'O\', \'O\', \'U\', \'U\', \'U\', \'U\', \'Y\', \'s\', \'a\', \'a\', \'a\', \'a\', \'a\', \'a\', \'ae\', \'c\', \'e\', \'e\', \'e\', \'e\', \'i\', \'i\', \'i\', \'i\', \'n\', \'o\', \'o\', \'o\', \'o\', \'o\', \'o\', \'u\', \'u\', \'u\', \'u\', \'y\', \'y\', \'A\', \'a\', \'A\', \'a\', \'A\', \'a\', \'C\', \'c\', \'C\', \'c\', \'C\', \'c\', \'C\', \'c\', \'D\', \'d\', \'D\', \'d\', \'E\', \'e\', \'E\', \'e\', \'E\', \'e\', \'E\', \'e\', \'E\', \'e\', \'G\', \'g\', \'G\', \'g\', \'G\', \'g\', \'G\', \'g\', \'H\', \'h\', \'H\', \'h\', \'I\', \'i\', \'I\', \'i\', \'I\', \'i\', \'I\', \'i\', \'I\', \'i\', \'IJ\', \'ij\', \'J\', \'j\', \'K\', \'k\', \'L\', \'l\', \'L\', \'l\', \'L\', \'l\', \'L\', \'l\', \'l\', \'l\', \'N\', \'n\', \'N\', \'n\', \'N\', \'n\', \'n\', \'O\', \'o\', \'O\', \'o\', \'O\', \'o\', \'OE\', \'oe\', \'R\', \'r\', \'R\', \'r\', \'R\', \'r\', \'S\', \'s\', \'S\', \'s\', \'S\', \'s\', \'S\', \'s\', \'T\', \'t\', \'T\', \'t\', \'T\', \'t\', \'U\', \'u\', \'U\', \'u\', \'U\', \'u\', \'U\', \'u\', \'U\', \'u\', \'U\', \'u\', \'W\', \'w\', \'Y\', \'y\', \'Y\', \'Z\', \'z\', \'Z\', \'z\', \'Z\', \'z\', \'s\', \'f\', \'O\', \'o\', \'U\', \'u\', \'A\', \'a\', \'I\', \'i\', \'O\', \'o\', \'U\', \'u\', \'U\', \'u\', \'U\', \'u\', \'U\', \'u\', \'U\', \'u\', \'A\', \'a\', \'AE\', \'ae\', \'O\', \'o\');\r\n            return str_replace($a, $b, $str);\r\n        };\r\n\r\n        $ru2Lat = function ($string) {\r\n            $rus = array(\'ё\',\'ж\',\'ц\',\'ч\',\'ш\',\'щ\',\'ю\',\'я\',\'Ё\',\'Ж\',\'Ц\',\'Ч\',\'Ш\',\'Щ\',\'Ю\',\'Я\',\'А\',\'Б\',\'В\',\'Г\',\'Д\',\'Е\',\'З\',\'И\',\'Й\',\'К\',\'Л\',\'М\',\'Н\',\'О\',\'П\',\'Р\',\'С\',\'Т\',\'У\',\'Ф\',\'Х\',\'Ъ\',\'Ы\',\'Ь\',\'Э\',\'а\',\'б\',\'в\',\'г\',\'д\',\'е\',\'з\',\'и\',\'й\',\'к\',\'л\',\'м\',\'н\',\'о\',\'п\',\'р\',\'с\',\'т\',\'у\',\'ф\',\'х\',\'ъ\',\'ы\',\'ь\',\'э\');\r\n            $lat = array(\'yo\',\'zh\',\'tc\',\'ch\',\'sh\',\'sh\',\'yu\',\'ya\',\'YO\',\'ZH\',\'TC\',\'CH\',\'SH\',\'SH\',\'YU\',\'YA\',\'A\',\'B\',\'V\',\'G\',\'D\',\'E\',\'Z\',\'I\',\'J\',\'K\',\'L\',\'M\',\'N\',\'O\',\'P\',\'R\',\'S\',\'T\',\'U\',\'F\',\'H\',\'_\',\'I\',\'_\',\'E\',\'a\',\'b\',\'v\',\'g\',\'d\',\'e\',\'z\',\'i\',\'j\',\'k\',\'l\',\'m\',\'n\',\'o\',\'p\',\'r\',\'s\',\'t\',\'u\',\'f\',\'h\',\'_\',\'i\',\'_\',\'e\');\r\n            $string = str_replace($rus,$lat,$string);\r\n            return($string);\r\n        };\r\n\r\n        if (!$json) {\r\n            if (!empty($this->request->files[\'file\'][\'name\'])) {\r\n\r\n            $file_ary = array();\r\n\r\n            if (!empty($this->request->files[\'file\']) ) {\r\n                $file_count = count($this->request->files[\'file\'][\'name\']);\r\n                $file_keys = array_keys($this->request->files[\'file\']);\r\n        \r\n                for ($i=0; $i<$file_count; $i++) {\r\n                    foreach ($file_keys as $key) {\r\n                        $file_ary[$i][$key] = $this->request->files[\'file\'][$key][$i];\r\n                    }\r\n                }\r\n            }\r\n\r\n            if (!empty($file_ary) ) {\r\n                foreach($file_ary as $cur_file) {\r\n                    if (!empty($cur_file[\'name\']) && is_file($cur_file[\'tmp_name\'])) {\r\n                        // Sanitize the filename\r\n                        $filename = basename($removeAccents(html_entity_decode($ru2Lat($removeAccents($cur_file[\'name\'])), ENT_QUOTES, \'UTF-8\')));\r\n                \r\n                        // Validate the filename length\r\n                        if ((utf8_strlen($filename) < 3) || (utf8_strlen($filename) > 255)) {\r\n                            $json[\'error\'] = $this->language->get(\'error_filename\');\r\n                        }\r\n                \r\n                        // Allowed file extension types\r\n                        $allowed = array(\r\n                            \'jpg\',\r\n                            \'jpeg\',\r\n                            \'gif\',\r\n                            \'png\'\r\n                        );\r\n                \r\n                        if (!in_array(utf8_strtolower(utf8_substr(strrchr($filename, \'.\'), 1)), $allowed)) {\r\n                            $json[\'error\'] = $this->language->get(\'error_filetype\');\r\n                        }\r\n                \r\n                        // Allowed file mime types\r\n                        $allowed = array(\r\n                            \'image/jpeg\',\r\n                            \'image/pjpeg\',\r\n                            \'image/png\',\r\n                            \'image/x-png\',\r\n                            \'image/gif\'\r\n                        );\r\n                \r\n                        if (!in_array($cur_file[\'type\'], $allowed)) {\r\n                            $json[\'error\'] = $this->language->get(\'error_filetype\');\r\n                        }\r\n                \r\n                        // Check to see if any PHP files are trying to be uploaded\r\n                        $content = file_get_contents($cur_file[\'tmp_name\']);\r\n                \r\n                        if (preg_match(\'/\\<\\?php/i\', $content)) {\r\n                            $json[\'error\'] = $this->language->get(\'error_filetype\');\r\n                        }\r\n                \r\n                        // Return any upload error\r\n                        if ($cur_file[\'error\'] != UPLOAD_ERR_OK) {\r\n                            $json[\'error\'] = $this->language->get(\'error_upload_\' . $this->request->files[\'file\'][\'error\']);\r\n                        }\r\n                    } else {\r\n                        $json[\'error\'] = $this->language->get(\'error_upload\');\r\n                    }\r\n                }\r\n            }\r\n        }\r\n    }\r\n\r\n        if (!$json) {\r\n            if ( !empty($file_ary) ) {\r\n                foreach($file_ary as $cur_file) {\r\n                    $filename = basename($removeAccents(html_entity_decode($ru2Lat($removeAccents($cur_file[\'name\'])), ENT_QUOTES, \'UTF-8\')));\r\n                    move_uploaded_file($cur_file[\'tmp_name\'], $directory . \'/\' . $filename);\r\n                }\r\n            }\r\n            $json[\'success\'] = $this->language->get(\'text_uploaded\');\r\n        } \r\n\r\n        $this->response->addHeader(\'Content-Type: application/json\');\r\n        $this->response->setOutput(json_encode($json));\r\n\r\n        return;\r\n\r\n            ]]></add>\r\n        </operation>\r\n    </file>\r\n</modification>', '0', '2017-12-25 11:22:56');
INSERT INTO `oc_modification` (`modification_id`, `name`, `code`, `author`, `version`, `link`, `xml`, `status`, `date_added`) VALUES ('5', 'UltraImageManager', '025698578', 'Miroslav', '1.0', 'http://www.opencart.com', '<?xml version="1.0" encoding="utf-8"?>\r\n<modification>\r\n    <name>UltraImageManager</name>\r\n    <code>025698578</code>\r\n    <version>1.0</version>\r\n    <author>Miroslav</author>\r\n    <link>http://www.opencart.com</link>\r\n    <file path="admin/view/template/catalog/product_form.tpl">\r\n        <operation>\r\n            <search><![CDATA[<?php echo $footer; ?>]]></search>\r\n            <add position="before"><![CDATA[\r\n                  <!-- input Last Folder Remember -->\r\n                <input type="hidden" value="<?php echo $last_folder; ?>" id="last-folder">\r\n             <!-- Multiple images select and insert into product form  -->\r\n<script>\r\n  $(document).ready(function() {\r\n\r\n    // Green button - Insert images into form - default order \r\n    $(document).on(\'click\', \'#multiple-insert\', function() {\r\n\r\n        var images = [];\r\n        $(\'#image-to-select:checked\').each(function(i){\r\n          images[i] = $(this).val();\r\n        });\r\n   \r\n        $(\'#input-image\').val(images[0]);\r\n        $(\'#thumb-image img\').attr(\'src\', \'../image/\' + images[0]).css(\'max-width\', \'100px\');\r\n\r\n        for(var i = 0; i < images.length-1; i++) {\r\n          addImage();\r\n          $(\'#input-image\' + i).val(images[i+1]);\r\n          $(\'#thumb-image\' + i + \' img\').attr(\'src\', \'../image/\' + images[i+1]).css(\'max-width\', \'100px\');\r\n        }\r\n        \r\n        $(\'#modal-image\').modal(\'hide\');\r\n\r\n    })\r\n  });\r\n\r\n\r\n  // Adding images while choosing main image\r\n  $(document).ready(function() {\r\n\r\n      $(document).on(\'click\', \'#select-main\', function () {\r\n      \r\n      var main_image = $(this).parent().find(\'input\').val();\r\n\r\n      // Getting checked images\r\n      var images = [];\r\n        $(\'#image-to-select:checked\').each(function(i){\r\n          images[i] = $(this).val();\r\n        });\r\n\r\n        // Remove main image from array of checked ones\r\n        var index = images.indexOf(main_image);\r\n        if (index > -1) {\r\n          images.splice(index, 1);\r\n        }\r\n        console.log(images + images.length)\r\n\r\n        // Adding main image into form\r\n        $(\'#input-image\').val(main_image);\r\n        $(\'#thumb-image img\').attr(\'src\', \'../image/\' + main_image).css(\'max-width\', \'100px\');\r\n        \r\n\r\n        // Additional images to form\r\n        if(images.length === 1) {\r\n           addImage();\r\n          $(\'#input-image0\').val(images[0]);\r\n          $(\'#thumb-image0\' + \' img\').attr(\'src\', \'../image/\' + images[0]).css(\'max-width\', \'100px\');\r\n\r\n        } else {\r\n          for(var i = 0; i <= images.length-1; i++) {\r\n\r\n            addImage();\r\n            $(\'#input-image\' + i).val(images[i]);\r\n            $(\'#thumb-image\' + i + \' img\').attr(\'src\', \'../image/\' + images[i]).css(\'max-width\', \'100px\');\r\n          }          \r\n        }\r\n\r\n        $(\'#modal-image\').modal(\'hide\');\r\n\r\n    });\r\n\r\n\r\n  });\r\n\r\n</script>\r\n            ]]></add>\r\n        </operation>\r\n    </file>  \r\n\r\n    <file path="admin/controller/catalog/product.php">\r\n      <operation>\r\n        <search><![CDATA[$data[\'tab_openbay\'] = $this->language->get(\'tab_openbay\');]]></search>\r\n        <add position="after"><![CDATA[\r\n\r\n        if(isset($this->session->data[\'last_folder\'])) {\r\n              $data[\'last_folder\'] = $this->session->data[\'last_folder\'];\r\n            } else {\r\n              $data[\'last_folder\'] = \'\';\r\n            }\r\n\r\n          ]]></add>\r\n      </operation>\r\n    </file>\r\n\r\n    <file path="admin/view/template/common/filemanager.tpl">\r\n      <operation>\r\n        <search><![CDATA[<button type="button" data-toggle="tooltip" title="<?php echo $button_delete; ?>" id="button-delete" class="btn btn-danger"><i class="fa fa-trash-o"></i></button>]]></search>\r\n        <add position="after"><![CDATA[\r\n           <button type="buton" data-toggle="tooltip" title="Multiple image insert" id="multiple-insert" class="btn btn-success"><i class="fa fa-files-o"></i></button>\r\n           <i class="fa fa-question-circle" data-toggle="tooltip" title="Green button on the top of the file manager adds selected picture to the product with the default order. That means that first image is set as default and others are set as additional images in the image tab.                             If you want to select different image as default then select all images and click on the plus button under the image you want as default. " data-placement="bottom"></i>\r\n          ]]></add>\r\n      </operation>\r\n\r\n      <operation>\r\n        <search><![CDATA[<div class="modal-dialog modal-lg">]]></search>\r\n        <add position="replace"><![CDATA[<div class="modal-dialog modal-lg" style="width:90%">]]></add>\r\n      </operation>\r\n\r\n      <operation>\r\n        <search><![CDATA[<input type="checkbox" name="path[]" value="<?php echo $image[\'path\']; ?>" />]]></search>\r\n        <add position="replace"><![CDATA[<input type="checkbox" name="path[]" value="<?php echo $image[\'path\']; ?>" id="image-to-select" />]]></add>\r\n      </operation>\r\n\r\n      <operation>\r\n        <search><![CDATA[<?php foreach (array_chunk($images, 4) as $image) { ?>]]></search>\r\n        <add position="replace"><![CDATA[<?php foreach (array_chunk($images, 6) as $image) { ?>]]></add>\r\n      </operation>\r\n\r\n      <operation>\r\n        <search><![CDATA[<div class="col-sm-3 text-center">]]></search>\r\n        <add position="replace"><![CDATA[<div class="col-sm-2 text-center">]]></add>\r\n      </operation>\r\n\r\n      <operation>\r\n        <search><![CDATA[<?php echo $image[\'name\']; ?></label>]]></search>\r\n        <add position="after"><![CDATA[\r\n           <button id="select-main" class="btn btn-primary btn-xs" title="Insert as default image"><i class="fa fa-plus-square"></i></button>\r\n        ]]></add>\r\n\r\n      </operation>\r\n\r\n      <operation>\r\n        <search><![CDATA[$(\'a.directory\').on(\'click\', function(e) {]]></search>\r\n        <add position="replace" offset="4"><![CDATA[\r\n          $(\'a.directory\').on(\'click\', function(e) {\r\n            e.preventDefault();\r\n\r\n            // Storing last folder into local storage\r\n            localStorage.setItem(\'lastFolder\', $(this).attr(\'href\'));\r\n\r\n            $(\'#modal-image\').load($(this).attr(\'href\'));\r\n          });\r\n\r\n        ]]></add>\r\n\r\n      </operation>\r\n\r\n      <operation>\r\n        <search><![CDATA[$(\'.pagination a\').on(\'click\', function(e) {]]></search>\r\n        <add position="replace" offset="4"><![CDATA[\r\n          $(\'.pagination a\').on(\'click\', function(e) {\r\n            e.preventDefault();\r\n            \r\n            // Storing last folder and page into local storage\r\n            localStorage.setItem(\'lastFolder\', $(this).attr(\'href\'));\r\n\r\n\r\n            $(\'#modal-image\').load($(this).attr(\'href\'));\r\n          });\r\n\r\n        ]]></add>\r\n\r\n      </operation>\r\n\r\n      <operation>\r\n        <search><![CDATA[$(\'#button-parent\').on(\'click\', function(e) {]]></search>\r\n        <add position="replace" offset="4"><![CDATA[\r\n          $(\'#button-parent\').on(\'click\', function(e) {\r\n            e.preventDefault();\r\n\r\n            // Storing last folder into local storage\r\n           localStorage.setItem(\'lastFolder\', $(this).attr(\'href\'));\r\n            \r\n            $(\'#modal-image\').load($(this).attr(\'href\'));\r\n          });\r\n\r\n        ]]></add>\r\n\r\n      </operation>\r\n\r\n    </file>\r\n    <file path="admin/view/javascript/common.js">\r\n      <operation>\r\n        <search><![CDATA[$(document).delegate(\'a[data-toggle=\\\'image\\\']\', \'click\', function(e) {]]></search>\r\n        <add position="replace" offset="47"><![CDATA[\r\n  $(document).delegate(\'a[data-toggle=\\\'image\\\']\', \'click\', function(e) {\r\n    e.preventDefault();\r\n  \r\n    var element = this;\r\n  \r\n    $(element).popover({\r\n      html: true,\r\n      placement: \'right\',\r\n      trigger: \'manual\',\r\n      content: function() {\r\n        return \'<button type="button" id="button-image" class="btn btn-primary"><i class="fa fa-pencil"></i></button> <button type="button" id="button-clear" class="btn btn-danger"><i class="fa fa-trash-o"></i></button>\';\r\n      }\r\n    });\r\n    \r\n    $(element).popover(\'toggle\');   \r\n  \r\n    $(\'#button-image\').on(\'click\', function() {\r\n      $(\'#modal-image\').remove();\r\n\r\n      if(localStorage[\'lastFolder\'] != \'\') {\r\n        var lastFolder = localStorage[\'lastFolder\'];\r\n        lastFolderUpdated = lastFolder.replace(\'thumb=thumb-image\', \'thumb=\' + $(element).attr(\'id\'));\r\n\r\n        imageManagerUrl = lastFolderUpdated;\r\n      } else {\r\n        imageManagerUrl = \'index.php?route=common/filemanager&token=\' + getURLVar(\'token\') + \'&target=\' + $(element).parent().find(\'input\').attr(\'id\') + \'&thumb=\' + $(element).attr(\'id\') + \'&directory=\' + $(\'#last-folder\').val();\r\n      }\r\n\r\n      $(\'#modal-image\').load($(this).attr(\'href\'));  \r\n      \r\n\r\n      $.ajax({\r\n        url: imageManagerUrl,\r\n        dataType: \'html\',\r\n        beforeSend: function() {\r\n          $(\'#button-image i\').replaceWith(\'<i class="fa fa-circle-o-notch fa-spin"></i>\');\r\n          $(\'#button-image\').prop(\'disabled\', true);\r\n        },\r\n        complete: function() {\r\n          $(\'#button-image i\').replaceWith(\'<i class="fa fa-upload"></i>\');\r\n          $(\'#button-image\').prop(\'disabled\', false);\r\n        },\r\n        success: function(html) {\r\n          $(\'body\').append(\'<div id="modal-image" class="modal">\' + html + \'</div>\');\r\n  \r\n          $(\'#modal-image\').modal(\'show\');\r\n        }\r\n      });\r\n  \r\n      $(element).popover(\'hide\');\r\n    });\r\n  \r\n    $(\'#button-clear\').on(\'click\', function() {\r\n      $(element).find(\'img\').attr(\'src\', $(element).find(\'img\').attr(\'data-placeholder\'));\r\n      \r\n      $(element).parent().find(\'input\').attr(\'value\', \'\');\r\n  \r\n      $(element).popover(\'hide\');\r\n    });\r\n  });\r\n\r\n\r\n        ]]></add>\r\n\r\n      </operation>\r\n    </file>\r\n\r\n    <file path="admin/controller/common/filemanager.php">\r\n      <operation>\r\n        <search><![CDATA[$images = array_splice($images, ($page - 1) * 16, 16);]]></search>\r\n        <add position="replace"><![CDATA[$images = array_splice($images, ($page - 1) * 18, 18);]]></add>\r\n      </operation>\r\n      <operation>\r\n        <search><![CDATA[$pagination->limit = 16;]]></search>\r\n        <add position="replace"><![CDATA[$pagination->limit = 18;]]></add>\r\n      </operation>\r\n       <operation>\r\n        <search><![CDATA[$directory = rtrim(DIR_IMAGE . \'catalog/\' . str_replace(array(\'../\', \'..\\\\\', \'..\'), \'\', $this->request->get[\'directory\']), \'/\');]]></search>\r\n        <add position="after"><![CDATA[\r\n          // Store last folder into session\r\n          $this->session->data[\'last_folder\'] = $this->request->get[\'directory\'];\r\n      ]]></add>\r\n      </operation>     \r\n\r\n    </file>\r\n\r\n</modification>', '0', '2017-12-26 21:43:25');
