 Name\r\nder abgerufenen Webseite, Datei, Datum und Uhrzeit des Abrufs, übertragene\r\nDatenmenge, Meldung über erfolgreichen Abruf, Browsertyp nebst Version, das\r\nBetriebssystem des Nutzers, Referrer URL (die zuvor besuchte Seite), IP-Adresse\r\nund der anfragende Provider.  Der Anbieter verwendet die Protokolldaten nur für\r\nstatistische Auswertungen zum Zweck des Betriebs, der Sicherheit und der\r\nOptimierung des Angebotes. Der Anbieterbehält sich jedoch vor, die\r\nProtokolldaten nachträglich zu überprüfen, wenn aufgrund konkreter\r\nAnhaltspunkte der berechtigte Verdacht einer rechtswidrigen Nutzung besteht.&lt;/font&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;b&gt;&lt;br&gt;&lt;/b&gt;&lt;/p&gt;&lt;h3&gt;&lt;b&gt;Umgang mit personenbezogenen Daten&lt;/b&gt;&lt;/h3&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;DE&quot; style=&quot;mso-ansi-language:DE&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;DE&quot; style=&quot;mso-ansi-language:DE&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Personenbezogene\r\nDaten sind Informationen, mit deren Hilfe eine Person bestimmbar ist, also\r\nAngaben, die zurück zu einer Person verfolgt werden können. Dazu gehören der\r\nName, die Emailadresse oder die Telefonnummer. Aber auch Daten über Vorlieben,\r\nHobbies, Mitgliedschaften oder welche Webseiten von jemandem angesehen wurden\r\nzählen zu personenbezogenen Daten.  Personenbezogene Daten werden von dem\r\nAnbieter nur dann erhoben, genutzt und weiter gegeben, wenn dies gesetzlich\r\nerlaubt ist oder die Nutzer in die Datenerhebung einwilligen.&lt;o:p&gt;&lt;/o:p&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;b&gt;&lt;br&gt;&lt;/b&gt;&lt;/p&gt;&lt;h3&gt;&lt;b&gt;Kontaktaufnahme&lt;/b&gt;&lt;/h3&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;DE&quot; style=&quot;mso-ansi-language:DE&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;DE&quot; style=&quot;mso-ansi-language:DE&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Bei der\r\nKontaktaufnahme mit dem Anbieter (zum Beispiel per Kontaktformular oder E-Mail)\r\nwerden die Angaben des Nutzers zwecks Bearbeitung der Anfrage sowie für den\r\nFall, dass Anschlussfragen entstehen, gespeichert.&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;h3&gt;&lt;b&gt;Newsletter&lt;/b&gt;&lt;/h3&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;DE&quot; style=&quot;mso-ansi-language:DE&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;DE&quot; style=&quot;mso-ansi-language:DE&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Mit dem\r\nNewsletter informieren wir Sie über uns und unsere Angebote.  Wenn Sie den\r\nNewsletter empfangen möchten, benötigen wir von Ihnen eine valide Email-Adresse\r\nsowie Informationen, die uns die Überprüfung gestatten, dass Sie der Inhaber\r\nder angegebenen Email-Adresse sind bzw. deren Inhaber mit dem Empfang des\r\nNewsletters einverstanden ist. Weitere Daten werden nicht erhoben. Diese Daten\r\nwerden nur für den Versand der Newsletter verwendet und werden nicht an Dritte\r\nweiter gegeben.  Mit der Anmeldung zum Newsletter speichern wir Ihre IP-Adresse\r\nund das Datum der Anmeldung. Diese Speicherung dient alleine dem Nachweis im\r\nFall, dass ein Dritter eine Emailadresse missbraucht und sich ohne Wissen des\r\nBerechtigten für den Newsletterempfang anmeldet.  Ihre Einwilligung zur\r\nSpeicherung der Daten, der Email-Adresse sowie deren Nutzung zum Versand des\r\nNewsletters können Sie jederzeit widerrufen. Der Widerruf kann über einen Link\r\nin den Newslettern selbst, in Ihrem Profilbereich oder per Mitteilung an die\r\noben stehenden Kontaktmöglichkeiten erfolgen.&lt;o:p&gt;&lt;/o:p&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;b&gt;&lt;br&gt;&lt;/b&gt;&lt;/p&gt;&lt;h3&gt;&lt;b&gt;Cookies&lt;/b&gt;&lt;/h3&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;DE&quot; style=&quot;mso-ansi-language:DE&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span lang=&quot;DE&quot; style=&quot;mso-ansi-language:DE&quot;&gt;Cookies sind\r\nkleine Dateien, die es ermöglichen, auf dem Zugriffsgerät der Nutzer (PC,\r\nSmartphone o.ä.) spezifische, auf das Gerät bezogene Informationen zu\r\nspeichern. Sie dienen zum einem der Benutzerfreundlichkeit von Webseiten und\r\ndamit den Nutzern (z.B. Speicherung von Logindaten). Zum anderen dienen sie, um\r\ndie statistische Daten der Webseitennutzung zu erfassen und sie zwecks\r\nVerbesserung des Angebotes analysieren zu können. Die Nutzer können auf den\r\nEinsatz der Cookies Einfluss nehmen. Die meisten Browser verfügen eine Option\r\nmit der das Speichern von Cookies eingeschränkt oder komplett verhindert wird.\r\nAllerdings wird darauf hingewiesen, dass die Nutzung und insbesondere der\r\nNutzungskomfort ohne Cookies eingeschränkt werden.  Sie können viele\r\nOnline-Anzeigen-Cookies von Unternehmen über die US-amerikanische Seite &lt;/span&gt;&lt;a href=&quot;http://www.aboutads.info/choices/&quot;&gt;&lt;span lang=&quot;DE&quot; style=&quot;mso-ansi-language:\r\nDE&quot;&gt;http://www.aboutads.info/choices/&lt;/span&gt;&lt;/a&gt;&lt;span lang=&quot;DE&quot; style=&quot;mso-ansi-language:\r\nDE&quot;&gt; oder die EU-Seite &lt;/span&gt;&lt;a href=&quot;http://www.youronlinechoices.com/uk/your-ad-choices/&quot;&gt;&lt;span lang=&quot;DE&quot; style=&quot;mso-ansi-language:DE&quot;&gt;http://www.youronlinechoices.com/uk/your-ad-choices/\r\n&lt;/span&gt;&lt;/a&gt;&lt;span lang=&quot;DE&quot; style=&quot;mso-ansi-language:DE&quot;&gt;verwalten.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;b&gt;&lt;br&gt;&lt;/b&gt;&lt;/p&gt;&lt;h3&gt;&lt;b&gt;Registrierfunktion&lt;/b&gt;&lt;/h3&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;DE&quot; style=&quot;mso-ansi-language:DE&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;DE&quot; style=&quot;mso-ansi-language:DE&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Die im Rahmen der\r\nRegistrierung eingegebenen Daten werden für die Zwecke der Nutzung des\r\nAngebotes verwendet. Die Nutzer können über angebots- oder\r\nregistrierungsrelevante Informationen, wie Änderungen des Angebotsumfangs oder\r\ntechnische Umstände per E-Mail informiert werden. Die erhobenen Daten sind aus\r\nder Eingabemaske im Rahmen der Registrierung ersichtlich. Dazu gehören [HIER\r\nBITTE DIE ERHOBENEN DATEN EINGEBEN, Z.B. NAME, POSTALISCHE ADRESSE,\r\nE-MAIL-ADRESSE, IP-ADRESSE UND DEREN ZWECK, ZUM BEISPIEL COMMUNITY ODER\r\nPRODUKTESTS].&lt;o:p&gt;&lt;/o:p&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;b&gt;&lt;br&gt;&lt;/b&gt;&lt;/p&gt;&lt;h3&gt;&lt;b&gt;Verwendung von Facebook Social Plugins&lt;/b&gt;&lt;/h3&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;DE&quot; style=&quot;mso-ansi-language:DE&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span lang=&quot;DE&quot; style=&quot;mso-ansi-language:DE&quot;&gt;Dieses Angebot\r\nverwendet Social Plugins (&quot;Plugins&quot;) des sozialen Netzwerkes\r\nfacebook.com, welches von der Facebook Ireland Ltd., 4 Grand Canal Square,\r\nGrand Canal Harbour, Dublin 2, Irland betrieben wird (&quot;Facebook&quot;).\r\nDie Plugins sind an einem der Facebook Logos erkennbar (weißes „f“ auf blauer\r\nKachel, den Begriffen &quot;Like&quot;, &quot;Gefällt mir&quot; oder einem\r\n„Daumen hoch“-Zeichen) oder sind mit dem Zusatz &quot;Facebook Social\r\nPlugin&quot; gekennzeichnet. Die Liste und das Aussehen der Facebook Social\r\nPlugins kann hier eingesehen werden: &lt;/span&gt;&lt;a href=&quot;https://developers.facebook.com/docs/plugins/&quot;&gt;&lt;span lang=&quot;DE&quot; style=&quot;mso-ansi-language:DE&quot;&gt;https://developers.facebook.com/docs/plugins/&lt;/span&gt;&lt;/a&gt;&lt;span lang=&quot;DE&quot; style=&quot;mso-ansi-language:DE&quot;&gt;.  Wenn ein Nutzer eine Webseite dieses\r\nAngebots aufruft, die ein solches Plugin enthält, baut sein Browser eine\r\ndirekte Verbindung mit den Servern von Facebook auf. Der Inhalt des Plugins\r\nwird von Facebook direkt an Ihren Browser übermittelt und von diesem in die\r\nWebseite eingebunden. Der Anbieter hat daher keinen Einfluss auf den Umfang der\r\nDaten, die Facebook mit Hilfe dieses Plugins erhebt und informiert die Nutzer\r\ndaher entsprechend seinem &lt;/span&gt;&lt;a href=&quot;http://www.facebook.com/help/?faq=17512&quot;&gt;&lt;span lang=&quot;DE&quot; style=&quot;mso-ansi-language:\r\nDE&quot;&gt;Kenntnisstand&lt;/span&gt;&lt;/a&gt;&lt;span lang=&quot;DE&quot; style=&quot;mso-ansi-language:DE&quot;&gt;:  Durch\r\ndie Einbindung der Plugins erhält Facebook die Information, dass ein Nutzer die\r\nentsprechende Seite des Angebots aufgerufen hat. Ist der Nutzer bei Facebook\r\neingeloggt, kann Facebook den Besuch seinem Facebook-Konto zuordnen. Wenn\r\nNutzer mit den Plugins interagieren, zum Beispiel den Like Button betätigen\r\noder einen Kommentar abgeben, wird die entsprechende Information von Ihrem\r\nBrowser direkt an Facebook übermittelt und dort gespeichert. Falls ein Nutzer\r\nkein Mitglied von Facebook ist, besteht trotzdem die Möglichkeit, dass Facebook\r\nseine IP-Adresse in Erfahrung bringt und speichert. Laut Facebook wird in\r\nDeutschland nur eine anonymisierte IP-Adresse gespeichert.  Zweck und Umfang\r\nder Datenerhebung und die weitere Verarbeitung und Nutzung der Daten durch\r\nFacebook sowie die diesbezüglichen Rechte und Einstellungsmöglichkeiten zum\r\nSchutz der Privatsphäre der Nutzer , können diese den Datenschutzhinweisen von\r\nFacebook entnehmen: &lt;/span&gt;&lt;a href=&quot;https://www.facebook.com/about/privacy/&quot;&gt;&lt;span lang=&quot;DE&quot; style=&quot;mso-ansi-language:DE&quot;&gt;https://www.facebook.com/about/privacy/&lt;/span&gt;&lt;/a&gt;&lt;span lang=&quot;DE&quot; style=&quot;mso-ansi-language:DE&quot;&gt;.  Wenn ein Nutzer Facebookmitglied ist\r\nund nicht möchte, dass Facebook über dieses Angebot Daten über ihn sammelt und\r\nmit seinen bei Facebook gespeicherten Mitgliedsdaten verknüpft, muss er sich\r\nvor dem Besuch des Internetauftritts bei Facebook ausloggen. Weitere\r\nEinstellungen und Widersprüche zur Nutzung von Daten für Werbezwecke, sind\r\ninnerhalb der Facebook-Profileinstellungen möglich: &lt;/span&gt;&lt;a href=&quot;https://www.facebook.com/settings?tab=ads&quot;&gt;&lt;span lang=&quot;DE&quot; style=&quot;mso-ansi-language:DE&quot;&gt;https://www.facebook.com/settings?tab=ads&lt;/span&gt;&lt;/a&gt;&lt;span lang=&quot;DE&quot; style=&quot;mso-ansi-language:DE&quot;&gt;.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;b&gt;&lt;br&gt;&lt;/b&gt;&lt;/p&gt;&lt;h3&gt;&lt;b&gt;Widerruf, Änderungen, Berichtigungen und Aktualisierungen&lt;/b&gt;&lt;/h3&gt;&lt;h5&gt;&lt;b&gt;&lt;br&gt;&lt;/b&gt;Der Nutzer hat das Recht, auf Antrag unentgeltlich Auskunft zu erhalten über die personenbezogenen Daten, die über ihn gespeichert wurden. Zusätzlich hat der Nutzer das Recht auf Berichtigung unrichtiger Daten, Sperrung und Löschung seiner personenbezogenen Daten, soweit dem keine gesetzliche Aufbewahrungspflicht entgegensteht.&lt;/h5&gt;&lt;h3&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;!--[if gte mso 9]&gt;&lt;xml&gt;\r\n &lt;o:OfficeDocumentSettings&gt;\r\n  &lt;o:AllowPNG&gt;&lt;/o:AllowPNG&gt;\r\n &lt;/o:OfficeDocumentSettings&gt;\r\n&lt;/xml&gt;&lt;![endif]--&gt;\r\n\r\n&lt;!--[if gte mso 9]&gt;&lt;xml&gt;\r\n &lt;w:WordDocument&gt;\r\n  &lt;w:View&gt;Normal&lt;/w:View&gt;\r\n  &lt;w:Zoom&gt;0&lt;/w:Zoom&gt;\r\n  &lt;w:TrackMoves&gt;&lt;/w:TrackMoves&gt;\r\n  &lt;w:TrackFormatting&gt;&lt;/w:TrackFormatting&gt;\r\n  &lt;w:PunctuationKerning&gt;&lt;/w:PunctuationKerning&gt;\r\n  &lt;w:ValidateAgainstSchemas&gt;&lt;/w:ValidateAgainstSchemas&gt;\r\n  &lt;w:SaveIfXMLInvalid&gt;false&lt;/w:SaveIfXMLInvalid&gt;\r\n  &lt;w:IgnoreMixedContent&gt;false&lt;/w:IgnoreMixedContent&gt;\r\n  &lt;w:AlwaysShowPlaceholderText&gt;false&lt;/w:AlwaysShowPlaceholderText&gt;\r\n  &lt;w:DoNotPromoteQF&gt;&lt;/w:DoNotPromoteQF&gt;\r\n  &lt;w:LidThemeOther&gt;EN-US&lt;/w:LidThemeOther&gt;\r\n  &lt;w:LidThemeAsian&gt;ZH-CN&lt;/w:LidThemeAsian&gt;\r\n  &lt;w:LidThemeComplexScript&gt;X-NONE&lt;/w:LidThemeComplexScript&gt;\r\n  &lt;w:Compatibility&gt;\r\n   &lt;w:BreakWrappedTables&gt;&lt;/w:BreakWrappedTables&gt;\r\n   &lt;w:SnapToGridInCell&gt;&lt;/w:SnapToGridInCell&gt;\r\n   &lt;w:WrapTextWithPunct&gt;&lt;/w:WrapTextWithPunct&gt;\r\n   &lt;w:UseAsianBreakRules&gt;&lt;/w:UseAsianBreakRules&gt;\r\n   &lt;w:DontGrowAutofit&gt;&lt;/w:DontGrowAutofit&gt;\r\n   &lt;w:SplitPgBreakAndParaMark&gt;&lt;/w:SplitPgBreakAndParaMark&gt;\r\n   &lt;w:EnableOpenTypeKerning&gt;&lt;/w:EnableOpenTypeKerning&gt;\r\n   &lt;w:DontFlipMirrorIndents&gt;&lt;/w:DontFlipMirrorIndents&gt;\r\n   &lt;w:OverrideTableStyleHps&gt;&lt;/w:OverrideTableStyleHps&gt;\r\n   &lt;w:UseFELayout&gt;&lt;/w:UseFELayout&gt;\r\n  &lt;/w:Compatibility&gt;\r\n  &lt;m:mathPr&gt;\r\n   &lt;m:mathFont m:val=&quot;Cambria Math&quot;&gt;&lt;/m:mathFont&gt;\r\n   &lt;m:brkBin m:val=&quot;before&quot;&gt;&lt;/m:brkBin&gt;\r\n   &lt;m:brkBinSub m:val=&quot;&amp;#45;-&quot;&gt;&lt;/m